import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from './jscomponents/Navbar';
import Home from './pages/Home';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <Route path = '/' exact
          component={Home}/>
